import logo from "./logo.svg";
import "./App.css";
import AddButton from "./components/Button";
import DayOne from "./components/DayOne";
import Navbar from "./components/Navbar";
function App() {
  return (
    <div className="App">
      <Navbar />
      <header className="App-header">
        <AddButton />
        <DayOne />
      </header>
    </div>
  );
}

export default App;
